Python MongoDB query to get list of documents where '_id' != id<p>I have multiple documents in the collection. Document contains <code>_id</code> and <code>transaction_id</code>. In most of the documents, <code>_id</code> is same as <code>transaction_id</code>. I have to check if there is any document for a particular <code>transaction_id</code> has non matching <code>_id</code>. For this, I am using below app</p>
<pre><code>all_trans_doc_list = list(tc_coll.find({}))    # Getting all docs from collection
for transaction_id in transaction_list:

    found = False
    for trans in all_trans_doc_list:
        if str(trans['_id']) == str(transaction_id ):
            found = False
        else:
            found = True



</code></pre>
<p>Problem with above approach is that, for ex I have transaction list as <code>[12345, 67890]</code>. So for transaction_id <code>[12345]</code> and <code>trans['_id']</code> matches, so found becomes False but for another <code>trans['_id']</code> it becomes True, so this approach is not correct. Can anyone please suggest a query which can list all the documents in which <code>_id</code> &amp; <code>transaction_id</code> are not matching. Please help. Thanks</p>

