Join two collections in MongoDB by merging properties from one into the other<p>I need help joining two collections in MongoDB.</p>
<p>I have two collections: Cards and Decks. I need to join them so that I have the properties of the cards document inside the decks document. Below are two examples in JSON format of each collection:</p>
<ol>
<li>Decks</li>
</ol>
<p>Example:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;608edd53a8220000b2000882&quot;
    },
    &quot;name&quot;: &quot;Izzet Phoenix&quot;,
    &quot;cards&quot;: {
        &quot;mainboard&quot;: [
            {
                &quot;qty&quot;: &quot;4&quot;,
                &quot;name&quot;: &quot;Arclight Phoenix&quot;,
                &quot;id&quot;: &quot;787de9ce-02c5-4a17-a88b-d38e83dbeb0b&quot;
            },
            ... a bunch of other cards in the same format (qty, name, id)
        ],
        &quot;sideboard&quot;: [
            {
                &quot;qty&quot;: &quot;2&quot;,
                &quot;name&quot;: &quot;Abrade&quot;,
                &quot;id&quot;: &quot;84319dfb-eaf7-4b98-8c4f-30f5e779591b&quot;
            },
            ... a bunch of other cards in the same format (qty, name, id)
        ]
    },
    ... a bunch of other properties of the deck
}
</code></pre>
<ol start="2">
<li>Cards</li>
</ol>
<p>Example:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;608b60d6a40a0000c9017853&quot;
    },
    &quot;name&quot;: &quot;Abrade&quot;,
    &quot;id&quot;: &quot;84319dfb-eaf7-4b98-8c4f-30f5e779591b&quot;,
    ... a bunch of other properties of the card
}
</code></pre>
<p>Note that the decks collection uses the &quot;id&quot; field of cards as a reference, and not the &quot;_id&quot; field.</p>
<p>This is the desired output I'm looking for:</p>
<pre class="lang-json prettyprint-override"><code>{
    &quot;_id&quot;: {
        &quot;$oid&quot;: &quot;608edd53a8220000b2000882&quot;
    },
    &quot;name&quot;: &quot;Izzet Phoenix&quot;,
    &quot;cards&quot;: {
        &quot;mainboard&quot;: [
            {
                &quot;qty&quot;: &quot;4&quot;,
                &quot;name&quot;: &quot;Arclight Phoenix&quot;,
                &quot;id&quot;: &quot;787de9ce-02c5-4a17-a88b-d38e83dbeb0b&quot;,
                ... add properties of the card Arclight Phoenix, with id = 787de9ce-02c5-4a17-a88b-d38e83dbeb0b
            },
            ... a bunch of other cards
        ],
        &quot;sideboard&quot;: [
            {
                &quot;qty&quot;: &quot;2&quot;,
                &quot;name&quot;: &quot;Abrade&quot;,
                &quot;id&quot;: &quot;84319dfb-eaf7-4b98-8c4f-30f5e779591b&quot;,
                ... add properties of the card Abrade, with id 84319dfb-eaf7-4b98-8c4f-30f5e779591b
            },
            ... a bunch of other cards
        ]
    },
    ... a bunch of other properties of the deck
}
</code></pre>
<p>I've tried looking into how to solve this, and I found that MongoDB has a $lookup stage, but I have no familiarity with the pipeline and stages concept, which ended up holding me back.</p>
<p>All help is appreciated.</p>
<p>Thank you for your time!</p>

